import React from 'react';

const RequestQuestionBank = () => {
  return (
    <div>
      <h2 className="centered-heading">Request Question Bank</h2>
      <p>Request a customized question bank for self-assessment.</p>
      <div>
        <label htmlFor="technology">Select Technology:</label>
        <select id="technology">
          <option value="tech1">Technology 1</option>
          <option value="tech2">Technology 2</option>
          {/* Add more options as needed */}
        </select>
        <button>Request</button>
      </div>
    </div>
  );
};

export default RequestQuestionBank;
